# These are Single-Extra rules re-ordered strictly for decreasing number of
# guesses per password candidates tested.  This ordering is good to use on
# the slowest (non-)hashes.
#
# Generated with:
# cut -c14- john.log | grep '^Score ' | sort -nk 4 | cut -d: -f2- | sed 's/\\/\\\\/g; s/\[/\\[/g; s/^-: //; s/^: //; s/^: //; s/ : / /g; s/ : / /g; s/ (?z / /g; s/ Tz / /g; s/ Tz / /g; s/ Tz / /g; s/ Tz / /g; s/ Q M Q/ Q/g; s/ :$//; s/ $/[ ]/'
# from a Single-Extra run with password.lst on pwned-passwords-sampler output
# for HIBP v8 (100M non-unique, ~54M unique hashes), counting unique guesses.
#
# Manually split into best (40%), worse (next 40%), and worst (final 20%),
# which achieve, respectively, most of the cracks (97%+), some more (2%+),
# and hardly any.  Also moved "-c l Q" (ranks low with our default wordlist,
# but silly not to try early on with some other wordlists) and specialized
# rules prefixed with "-s" and "-p" (which were not ranked) back into "best".
